    <div  style={{width:"100%"}}>
    <BodyContainer>
        <TaskGroup style={{flex: '0 0 55%'}}>
          <h2 style={{textAlign:"left", marginLeft:"24px"}}>Tasks for Today</h2>
          {Array.from({ length: 5 }, (_, index) => (
                <Task/>
            ))}
          <div style={{display:"flex", flexDirection:"row", padding:"32x", justifyContent:"center", gap:"24px"}}>
            <a style={{textDecoration:"underline", color:"#0562a5"}}>1</a>
            <a>2</a>
            <a>3</a>
            <a>4</a>
            <a>5</a>
          </div>
        </TaskGroup>
        <TaskGroup style={{flex: '0 0 35%'}}>
          <h3>Tasks</h3>
          <TaskItem>ftt</TaskItem>
        </TaskGroup>
    </BodyContainer>
    </div>
  );
}

export default ContentBody;
